import React, { useEffect } from 'react';
import { CustomPost } from 'utils/api';

function AutoLogin() {
	useEffect(() => {
		const jwt = localStorage.getItem('jwt');
		console.log(jwt);
		if (jwt !== null) {
			const res = CustomPost({
				url: '/web/auto-login',
			});
		}
	}, []);

	return null;
}

export default AutoLogin;
